import React from 'react';
import './App.css';

function iBox(props){
  return (
    <form>4yy
    <label for="box">{props.name}</label>
    <input type="text" id="box"> </input>
    </form>
  );
}

function App() {
  return (
    <div className="App">
    <h1>Hello</h1>
    <table className="table table-striped">
      <tr>
      <th>No</th>
      <th>Name</th>
      <th>Person</th>
      <th>Amount</th>
      <th>Other</th>
      </tr>
    </table>

    </div>
  );
}

export default App;
